(1, 1, 'ar', 'اليرموك، الرياض 13251، المملكة العربية السعودية', '<h2 style=\"text-align: right;\">صفحة سياسة الخصوصية لموقع اسس الانجاز</h2>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<p style=\"text-align: right;\">**سياسة الخصوصية لموقع اسس الانجاز**</p>\r\n<p style=\"text-align: right;\">أخر تحديث:&nbsp;</p>\r\n<p style=\"text-align: right;\">نرحب بكم في موقعنا \"اسس الانجاز\". تلتزم الشركة بحماية خصوصيتكم ومعلوماتكم الشخصية. يرجى قراءة بيان الخصوصية التالي لفهم كيفية جمع واستخدام وحماية المعلومات التي تقدمونها لنا.</p>\r\n<p style=\"text-align: right;\">**1. المعلومات التي نقوم بجمعها:**</p>\r\n<p style=\"text-align: right;\">نقوم بجمع المعلومات التي تقدمونها لنا عند استخدام موقعنا، وذلك عندما تسجلون حسابًا، أو تقديم طلب، أو تتفاعلون مع المحتوى الخاص بنا. يمكن أن تشمل هذه المعلومات الاسم، والبريد الإلكتروني، ورقم الهاتف، ومعلومات أخرى ذات صلة.</p>\r\n<p style=\"text-align: right;\">**2. كيفية استخدام المعلومات:**</p>\r\n<p style=\"text-align: right;\">نستخدم المعلومات التي نقوم بجمعها لتقديم الخدمات والدعم للمستخدمين، ولتحسين تجربة المستخدم، ولضمان أمان المعلومات.</p>', '<h2 style=\"text-align: right;\">صفحة سياسة الخصوصية لموقع اسس الانجاز</h2>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<p style=\"text-align: right;\">**سياسة الخصوصية لموقع اسس الانجاز**</p>\r\n<p style=\"text-align: right;\">أخر تحديث:&nbsp;</p>\r\n<p style=\"text-align: right;\">نرحب بكم في موقعنا \"اسس الانجاز\". تلتزم الشركة بحماية خصوصيتكم ومعلوماتكم الشخصية. يرجى قراءة بيان الخصوصية التالي لفهم كيفية جمع واستخدام وحماية المعلومات التي تقدمونها لنا.</p>\r\n<p style=\"text-align: right;\">**1. المعلومات التي نقوم بجمعها:**</p>\r\n<p style=\"text-align: right;\">نقوم بجمع المعلومات التي تقدمونها لنا عند استخدام موقعنا، وذلك عندما تسجلون حسابًا، أو تقديم طلب، أو تتفاعلون مع المحتوى الخاص بنا. يمكن أن تشمل هذه المعلومات الاسم، والبريد الإلكتروني، ورقم الهاتف، ومعلومات أخرى ذات صلة.</p>\r\n<p style=\"text-align: right;\">**2. كيفية استخدام المعلومات:**</p>\r\n<p style=\"text-align: right;\">نستخدم المعلومات التي نقوم بجمعها لتقديم الخدمات والدعم للمستخدمين، ولتحسين تجربة المستخدم، ولضمان أمان المعلومات.</p>', '', '<p style=\"text-align: right;\"><strong>حق الراتب</strong></p>\r\n<p style=\"text-align: right;\">الحق في استلام الراتب والأجور بشكل دوري وفقًا للاتفاق المتفق عليه</p>\r\n<p style=\"text-align: right;\"><strong>حق الإجازات</strong></p>\r\n<p style=\"text-align: right;\">الحق في الاستفادة من إجازات مدفوعة الأجر وفقًا للقوانين العمالية</p>\r\n<p style=\"text-align: right;\"><strong>حق الحماية الصحية</strong></p>\r\n<p style=\"text-align: right;\">الحق في التأمين الصحي والرعاية الطبية خلال فترة العمل</p>\r\n<p style=\"text-align: right;\"><strong>حق السلامة والأمان</strong></p>\r\n<p style=\"text-align: right;\">الحق في بيئة عمل آمنة وخالية من المخاطر الصحية والسلامة</p>\r\n<p style=\"text-align: right;\"><strong>&nbsp;حق التمييز</strong></p>\r\n<p style=\"text-align: right;\">الحق في عدم تعرضهم للتمييز أو المضايقة بناءً على الجنس أو العرق أو الدين أو اللون أو العمر</p>\r\n<p style=\"text-align: right;\"><strong>&nbsp;حق الاستراحة</strong></p>\r\n<p style=\"text-align: right;\">الحق في فترات استراحة منتظمة خلال فترات العمل</p>\r\n<p>&a', '<p style=\"text-align: right;\"><strong>حق الراتب</strong></p>\r\n<p style=\"text-align: right;\">الحق في استلام الراتب والأجور بشكل دوري وفقًا للاتفاق المتفق عليه</p>\r\n<p style=\"text-align: right;\"><strong>حق الإجازات</strong></p>\r\n<p style=\"text-align: right;\">الحق في الاستفادة من إجازات مدفوعة الأجر وفقًا للقوانين العمالية</p>\r\n<p style=\"text-align: right;\"><strong>حق الحماية الصحية</strong></p>\r\n<p style=\"text-align: right;\">الحق في التأمين الصحي والرعاية الطبية خلال فترة العمل</p>\r\n<p style=\"text-align: right;\"><strong>حق السلامة والأمان</strong></p>\r\n<p style=\"text-align: right;\">الحق في بيئة عمل آمنة وخالية من المخاطر الصحية والسلامة</p>\r\n<p style=\"text-align: right;\"><strong>&nbsp;حق التمييز</strong></p>\r\n<p style=\"text-align: right;\">الحق في عدم تعرضهم للتمييز أ